import React from 'react';
import { Nav, NavbarContainer, NavLogo } from './navBarElements';
import logo from '../../images/logo.png';

const Navbar = () => {
  return (
    <>
       <Nav>
            <NavbarContainer>
                <NavLogo to='/'><img src={logo} height={80} width={80} alt='logo' /></NavLogo>
                <MobileIcon>
                    <FaBars />
                </MobileIcon>
                <NavMenu>
                    <NavItem>
                        <NavLinks to="about">About</NavLinks>
                    </NavItem>
                </NavMenu>
            </NavbarContainer>
       </Nav>
    </>
  );
};

export default Navbar;
